import './App.css';

function App(props) {
  return (
    <div className="body">
      {props.offres && props.offres.map((e, i) => (
        <div key={i} className="offre">
          {/* Replace this placeholder content with your actual content */}
          <h3>{e.name}</h3>
          <p>{e.description}</p>
          <a href={e.link}>Learn More</a>
        </div>
      ))}
     
  </div>
  )
}

export default App;
